import React, { Component } from 'react'

export default class Slide2 extends Component {
    render() {
        return (
            <div className="bg-image ripple" data-mdb-ripple-color="light">
                <img src="img/sell-btn.jpg" class="w-100" />
            </div>
        )
    }
}
